function getRadioVal(val)
{
	document.getElementById('showControl').style.display = '';
	if(val==1)
		document.getElementById('showControl').innerHTML = 'Give Issue Date: <input type="text" name="issueDate" id="issueDate" size="10" maxlength="10" value="<?php echo date("d-m-Y"); ?>" /> (dd-mm-yyyy)';
	else if(val==2)
		document.getElementById('showControl').innerHTML = 'Give Renewal Date: <input type="text" name="renewDate" id="renewDate" size="10" maxlength="10" value="<?php echo date("d-m-Y"); ?>" /> (dd-mm-yyyy)';
	else if(val==3)
		get_dealer();
	else if(val==4)
		get_state();
	else if(val==5)
		get_city1();
	document.getElementById('submit').disabled = false;
}

function resetAll()
{
	document.getElementById('select1').checked = false;
	document.getElementById('select2').checked = false;
	document.getElementById('select3').checked = false;
	document.getElementById('select4').checked = false;
	document.getElementById('select5').checked = false;
	document.getElementById('showControl').innerHTML = '&nbsp;';
	document.getElementById('submit').disabled = true;
}

function setPrintPage(){
	if(document.getElementById('select1').checked){
		var retval = validate_printpc(1);
		var p = "printofpc.php?p1=1&p2="+document.getElementById('issueDate').value;
	} else if(document.getElementById('select2').checked){
		var retval = validate_printpc(2);
		var p = "printofpc.php?p1=2&p2="+document.getElementById('renewDate').value;
	} else if(document.getElementById('select3').checked){
		var retval = validate_printpc(3);
		var p = "printofpc.php?p1=3&p2="+document.getElementById('dealerName').value;
	} else if(document.getElementById('select4').checked){
		var retval = validate_printpc(4);
		var p = "printofpc.php?p1=4&p2="+document.getElementById('stateName').value;
	} else if(document.getElementById('select5').checked){
		var retval = validate_printpc(5);
		var p = "printofpc.php?p1=5&p2="+document.getElementById('cityName').value;
	}
	if(retval){
		window.open(p, 'PrintCertificate', 'width=300,height=200, resizable=no, scrollbars=no, toolbar=no, location=no, directories=no, status=no, menubar=no, copyhistory=no');
	}
}

function validate_printpc(value1)
{
	if(value1 == 1){
		if(document.getElementById('issueDate').value==""){
			alert("* Please input issue date !!");
			document.getElementById('issueDate').focus();
			return false;
		} else {
			return true;
		}
	} else if(value1 == 2){
		if(document.getElementById('renewDate').value==""){
			alert("* Please input renewal date !!");
			document.getElementById('renewDate').focus();
			return false;
		} else {
			return true;
		}
	} else if(value1 == 3){
		if(document.getElementById('dealerName').value==0){
			alert("* please select dealer / sub-dealer name !!");
			document.getElementById('dealerName').focus();
			return false;
		} else {
			return true;
		}
	} else if(value1 == 4){
		if(document.getElementById('stateName').value==0){
			alert("* please select state name !!");
			document.getElementById('stateName').focus();
			return false;
		} else {
			return true;
		}
	} else if(value1 == 5){
		if(document.getElementById('cityName').value==0){
			alert("* please select city name !!");
			document.getElementById('cityName').focus();
			return false;
		} else {
			return true;
		}
	}
}
